import React from 'react';
// import logo from './logo.svg';
import './App.css';
import {BoxPreview} from "./components/Box/BoxPreview";

const members = [
    {firstName: 'John', lastName: 'Doe', id: '1'},
    {firstName: 'Louis', lastName: 'Lane', id: '2'},
];
function App() {
  return (
    <div className="App">
      <header className="App-header">
          <BoxPreview title={'Команда'} type={'team'} id={'1'} leader={'Chanov'} members={members} />
      </header>
        <main>
        </main>
    </div>
  );
}

export default App;
